import React from 'react'
import { AppBar, Toolbar, Typography, makeStyles, Button, Box, Card, CardContent} from '@material-ui/core'; 
import Header from '../header/Header'
import contact from '/Users/shelabhtyagi/Desktop/car wash/car-wash/src/components/images/contact.png'




const useStyle = makeStyles((theme) => ({
	page: {
		background: '#0C0A44',
	},
	title: {
		color: 'white',
		fontWeight: 'bold',
		fontSize: '450%',
		marginTop: '5%',
		marginLeft: '7%',
	},
	red: {
		color: '#FE5959',
	},
	body: {
		width:'25%',
		color: 'white',
		fontSize: '120%',
		marginTop: '5%',
		marginLeft: '7%',
	},
	img: {
		marginTop: '-50%',
		marginLeft: '30%',
		width: '60%',
	}
}));




function Contact() {
	const classes = useStyle();
	return (
		<Box className={classes.page}>
			<Header />
			<Typography className={classes.title}>
				Have a <span className={classes.red}>Question?</span><br/>Look here
			</Typography>
			<Typography className={classes.body}>
				Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. 
			</Typography>
			<img className={classes.img} src={
					contact}
			/>
		</Box>
	)
}

export default Contact;
